$(document).ready(function() { 	
    $('#example').DataTable({        
        language: {
                "lengthMenu": "Mostrar _MENU_ registros",
                "zeroRecords": "No se encontraron resultados",
                "info": "Mostrando registros del _START_ al _END_ de un total de _TOTAL_ registros",
                "infoEmpty": "Mostrando registros del 0 al 0 de un total de 0 registros",
                "infoFiltered": "(filtrado de un total de _MAX_ registros)",
                "sSearch": "Buscar:",
                "oPaginate": {
                    "sFirst": "Primero",
                    "sLast":"Ãšltimo",
                    "sNext":"Siguiente",
                    "sPrevious": "Anterior"
			     },
			     "sProcessing":"Procesando...",
            },
        //para usar los botones   
        responsive: "true",
        dom: 'Bfrtilp',       
        buttons:[ 
			{
				extend:    'excelHtml5',
				text:      '<i class="fas fa-file-excel"></i> ',
				titleAttr: 'Exportar a Excel',
				className: 'btn btn-success',
				excelStyles: {

					template: 'cyan_medium'

				}
			},
			{
				extend:    'pdfHtml5',
				text:      '<i class="fas fa-file-pdf"></i> ',
				titleAttr: 'Exportar a PDF',
				className: 'btn btn-danger',

				customize: function(doc) {
					//Remover el titulo creado por la datatable
					doc.content.splice(0, 1);

					var now = new Date();
					var jsDate = now.getDate() + '-' + (now.getMonth() + 1) + '-' + now.getFullYear();

					doc.pageMargins = [20, 60, 20, 30]; //left, top, right, bottom
					doc.defaultStyle.fontSize = 10;

					doc.styles.tableHeader.fontSize = 12;
					doc['header'] = (function() {
						return {
							columns: [{
									image: 'data:image/jpeg;base64,',
									width: 70,
									alignment: 'left',
									margin: 0
								},
								{
									alignment: 'left',
									italics: true,
									text: 'Clinica Health Home',
									fontSize: 20,
									bold: true,
								},
								{
									alignment: 'right',
									fontSize: 15,
									italics: true,
									bold: true,
									text: 'Reporte'
								}
							],
							margin: 20
						}
					});

					doc['footer'] = (function(page, pages) {
						return {
							columns: [{
									alignment: 'left',
									text: ['Created on: ', {
										text: jsDate.toString()
									}]
								},
								{
									alignment: 'right',
									text: ['page ', {
										text: page.toString()
									}, ' of ', {
										text: pages.toString()
									}]
								}
							],
							margin: 20
						}
					});
					var objLayout = {};
					objLayout['hLineWidth'] = function(i) {
						return .5;
					};
					objLayout['vLineWidth'] = function(i) {
						return .5;
					};
					objLayout['hLineColor'] = function(i) {
						return '#aaa';
					};
					objLayout['vLineColor'] = function(i) {
						return '#aaa';
					};
					objLayout['paddingLeft'] = function(i) {
						return 4;
					};
					objLayout['paddingRight'] = function(i) {
						return 4;
					};
					doc.content[0].layout = objLayout;
				}
			},
			{

				extend:    'print',
				text:      '<i class="fa fa-print"></i> ',
				titleAttr: 'Imprimir',
				className: 'btn btn-info',
				
				customize: function (window) {
                    $(window.document.body).children().eq(0).after('<img src="data:image/jpeg;base64," alt="Loguito jiji" style="position: absolute; right: 10px; top: 0%; width: 120px;">')
				}        

			},
		]	        
    });     
});